import styled from 'styled-components';

export const Header = styled.div`
  padding: 39px 140px;
  max-width: 100%;
  display: flex;

  nav{
    ul{
    list-style-type: none;
    margin: 0;
    padding: 0;
    };

    a{
      text-align: left;
      font: normal normal medium 30px/38px;
      font-family: 'Montserrat';
      font-weight: 600;
      letter-spacing: 0px;
      color: #071242;
      opacity: 1;
      text-decoration: none;
      & + a{
        margin-left: 33px;
      };
    };

  button{
    background-color: #071242;
  }
}
`
